'use strict';

var apps = angular.module('dylurp', [
    'ngRoute',
    'ngResource',
    'ui.bootstrap',
    'blockUI',
    'chart.js'
]);

apps.config(['$routeProvider', '$httpProvider', 'blockUIConfig', function($routeProvider, $httpProvider, blockUIConfig) {
    $routeProvider
        .when('/', {
            templateUrl: 'html/main.html',
            controller: 'MainCtrl'
        })
        .when('/konfigurasi/bahagian', {
            templateUrl: 'html/konfigurasi/bahagian/senarai.html',
            controller: 'SenaraiBahagian'
        })
        .when('/penilaian', {
            templateUrl: 'html/penilaian/senarai_penilaian_latihan.html',
            controller: 'SenaraiPenilaianLatihan'
        })
        .when('/penilaian/:penilaianId', {
            templateUrl: 'html/penilaian/penilaian_latihan.html',
            controller: 'PenilaianLatihan'
        })
        .when('/penilaian/:penilaianId/daftarjawapan', {
            templateUrl: 'html/penilaian/daftar_jawapan_penilaian.html',
            controller: 'DaftarJawapanPenilaian'
        })
        .when('/penilaian/:penilaianId/:pesertaId', {
            templateUrl: 'html/penilaian/jawapan_penilaian.html',
            controller: 'JawapanPenilaian'
        })
        .when('/analisa', {
            templateUrl: 'html/analisa/senarai.html',
            controller: 'SenaraiAnalisaLatihan'
        })
        .when('/analisa/baru', {
            templateUrl: 'html/analisa/maklumat.html',
            controller: 'MaklumatAnalisaLatihan'
        })
        .when('/analisa/maklumat/:analisaId', {
            templateUrl: 'html/analisa/maklumat.html',
            controller: 'MaklumatAnalisaLatihan'
        })
        .when('/profile', {
            templateUrl: 'html/profile.html',
            controller: 'ProfileCtrl'
        })
        .when('/404', {
            templateUrl: 'html/404.html'
        })
        .otherwise({
            redirectTo: '/404'
        });

    $httpProvider.interceptors.push('noCacheInterceptor');
    $httpProvider.defaults.headers.common  = {
        'X-CSRF-TOKEN': $('meta[name=csrf-token]').attr("content")
    };

    blockUIConfig.message = 'Sila tunggu sebentar!';
    blockUIConfig.delay = 0;
    blockUIConfig.blockBrowserNavigation = true;
}]);

apps.factory('noCacheInterceptor', function (){
    return {
        request: function (config) {
            if(config.method==='GET' && config.url.split('/')[0] === 'api'){
                var separator = config.url.indexOf('?') === -1 ? '?' : '&';
                config.url = config.url+separator+'cb=' + new Date().getTime();
            }
            return config;
        }
    };
});

angular.module('dylurp')
    .directive('breadcrumb', function() {
        return {
            restrict: 'A',
            templateUrl: 'html/directive/breadcrumb.html',
            link: function(scope, element, attributes){

                scope.previousmenu = (attributes.previousmenu == undefined || attributes.previousmenu == '')? [] : JSON.parse(attributes.previousmenu);
                scope.currentmenu = attributes.currentmenu;

            }
        }
    });
angular.module('dylurp')
    .provider('AnalisaLatihanModel', function () {

        this.$get = ['$resource', function ($resource) {

            return $resource('API/v1/latihan/analisa/analisa/:analisa_id/:option', {}, {update: {method: 'PUT'}});

        }];

    });
angular.module('dylurp')
    .provider('PenilaianLatihanModel', function () {

        this.$get = ['$resource', function ($resource) {

            return $resource('API/v1/latihan/penilaian/penilaian/:penilaian_id/:option', {}, {update: {method: 'PUT'}});

        }];

    })
    .provider('JawapanModel', function () {

        this.$get = ['$resource', function ($resource) {

            return $resource('API/v1/latihan/penilaian/jawapan/:peserta_id/:option', {}, {update: {method: 'PUT'}});

        }];

    });

angular.module('dylurp')
    .provider('BahagianModel', function () {

        this.$get = ['$resource', function ($resource) {

            return $resource('API/v1/konfigurasi/bahagian/:bahagian_id/:option', {}, {update: {method: 'PUT'}});

        }];

    });
angular.module('dylurp')
    .controller('MainCtrl', ['$scope', '$http', function($scope, $http) {

        $scope.labels = ["Januari", "Febuari", "Mac", "April", "May", "Jun", "Julai", "Ogos", "September", "November", "December"];
        $scope.chartoptions = {
            responsive: false,
            maintainAspectRatio: false,
        };

        $scope.yearList = [2015];
        var currentYear = new Date().getFullYear();
        var start = currentYear - $scope.yearList[0];
        for(var i = 0; i < start; i++) {
            $scope.yearList.push(currentYear + i);
        }

        $scope.form = {
            tahunsblm: 2015,
            tahunsehingga: currentYear
        };

        var generateFirstChart = function() {

            $http.get('API/v1/dashboard', {params: $scope.form})
                .then(function(results) {

                    $scope.series = [];
                    $scope.data = [];
                    var resultsGroupByYear = _.groupBy(results.data, 'tahun');

                    _.each(Object.keys(resultsGroupByYear), function(key) {
                        $scope.series.push(key);

                        var dataInSeries = [];
                        var notFound = 0;

                        for (var i = 1; i < 13; i++) {

                            var found = _.find(resultsGroupByYear[key], function(o) {
                                return o.bulan == i;
                            });

                            if(found) {
                                dataInSeries.push(found.total);
                            } else {
                                dataInSeries.push(0);
                            }

                        }

                        $scope.data.push(dataInSeries);

                    });

                }, function(error) {
                    console.log(error);
                });
        }

        $scope.$watch('form', function() {
            generateFirstChart();
        }, true);

    }]);
